import React from 'react';
import Constants from 'expo-constants';
import {Button, TextInput, Text, View, TouchableOpacity} from 'react-native';
import {Routes, NativeRouter, Redirect, Route, Switch, Link } from 'react-router-native';
import IniciarSesion from './component/IniciarSesion';

const Option2 = () => <Text>Opción 1</Text>;
const Menu = () => <Text>Menú</Text>;


const Main = ()=>{

    return(
        <NativeRouter>
        <View>


          <Routes>
            <Route path="/" element={
              <View>
               <IniciarSesion/>
              </View>
            } />
            <Route path="/sing-in" element={<Option2 />} />
          </Routes>
        </View>
      </NativeRouter>



    )
}
export default Main;
